    const searchButtonStyle = {
        variant: "contained",
        size: "small",
        color: "primary",
        sx: {},
    };

    return (
        <Box {...boxStyle}>
            <Container>
            <SeccionFiltros/>
                
            </Container>
        </Box>
    );
}

export default ClientesBusqueda;
